import React from 'react'
import Status from './status/Status';
import Post from './post/Post';
import data from '../../data/data.json';
import './feed.css';


function Feed() {
    return (
        <div className="parent-2">
            <Status />
            {data.map(()=> (
                <Post key={data.id} posts={data}/>
            ))}
        </div>
    )
}

export default Feed
